    to the 'Charles Gonzales for Congress' campaign on June 17, 2004, was mistakenly
    deposited by the 'Bishop for Congress' campaign. (Both candidates use the same
    fundraiser.) The 'Bishop for Congress' campaign issued a refund check to our PAC
    which was deposited on June 23, 2004 and a replacement contribution to 'Charles
    Gonzales for Congress' was issued the same day. The refund from the 'Bishop for
    Congress' campaign is reported in line 16 of this report and the replacement contribution
    to 'Charles Gonzales for Congress' is reported in line 23. None of these transactions
    should present a problem with contribution limits. I spoke with FEC Analyst Jennifer
    Jones who suggested that we include this memo to clarify the situation."
